import React, {Component} from 'react';

import Button from "@material-ui/core/Button";
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Form from 'react-bootstrap/Form';
import NavDropdown from 'react-bootstrap/NavDropdown';
import FormControl from "react-bootstrap/es/FormControl";
import Link from "@material-ui/core/Link";



class HeadNavbar extends Component{


    render() {

        return (
            <Navbar bg="light" expand="lg">
                <Navbar.Brand href="">Buzzlink</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                        <Link href="/">Venues</Link>
                        <Link href="/artists">Artists</Link>
                        <NavDropdown title="About Us" id="basic-nav-dropdown">
                            <NavDropdown.Item href="#action/3.1">Buzzing feeds</NavDropdown.Item>
                            <NavDropdown.Divider />
                            <NavDropdown.Item href="#action/3.4">Team</NavDropdown.Item>
                        </NavDropdown>
                    </Nav>
                    <Form inline>
                        <FormControl type="text" placeholder="Search" className="mr-sm-2" />
                        <Button variant="outline-success">Search</Button>
                    </Form>
                </Navbar.Collapse>
            </Navbar>


        );
    }
}

export default HeadNavbar;
